window.bookSummaryJSON = "<p><b>Evelyn enjoyed living a nice quiet life in an anarchic pirate port, far from the world she’d once conquered.</b></p> <p>Then came an attack by mercenaries that made her angry. By the time the dust settled, she had a group of former slaves which she’d freed, her djinn assistant had convinced several of the women that they should join Evelyn’s brand-new harem, and she was looking for a new home, likely aboard a ship.</p> <p>If nothing else, it was going to make Evelyn’s life more interesting, and she almost looked forward to it. If the rest of the cluster was sweating bullets at the reemergence of a notorious warlord, that was <i>their</i> problem, not hers.</p>"; 
